const IndustryAg = (props) =>{

    return(
        <IndustryContainer>
            <ImgScrollAg/>
            <IndustryTextComp 
            hed='Agriculture' 
            hedDes='Making Ethical and Sustainable claims you can trust'
            plc='Speak with our expert team'
            btnDet='Schedule a call'
            />

            </IndustryContainer>
    );  
}

export default IndustryAg;
